PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "products_country" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "coordinate_w" real NOT NULL, "coordinate_h" real NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "products_shop" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "description" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "photo" varchar(100) NOT NULL, "is_published" bool NOT NULL, "rating" real NOT NULL, "coordinate_h" real NOT NULL, "coordinate_w" real NOT NULL, "city_id" bigint NOT NULL REFERENCES "products_city" ("id") DEFERRABLE INITIALLY DEFERRED, "address" varchar(2000) NOT NULL, "workTime" varchar(99) NOT NULL, "phoneNumber" varchar(99) NOT NULL, "premium_status_id" bigint NULL REFERENCES "products_premiumstatus" ("id") DEFERRABLE INITIALLY DEFERRED, "typeOfShop_id" bigint NULL REFERENCES "products_typeofshop" ("id") DEFERRABLE INITIALLY DEFERRED, "sorting_number" integer NULL, "instagram_login" varchar(50) NULL, "web_site" varchar(200) NULL, "youtube_src" varchar(1000) NULL, "tiktok_login" varchar(50) NULL);
CREATE TABLE IF NOT EXISTS "products_premiumstatus" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "products_productprice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "price" real NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "product_id" bigint NOT NULL REFERENCES "products_products" ("id") DEFERRABLE INITIALLY DEFERRED, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED, "new_price" real NOT NULL);
CREATE TABLE IF NOT EXISTS "products_generalcategories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_typeofshop" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_shop_generalType" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED, "generalcategories_id" bigint NOT NULL REFERENCES "products_generalcategories" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_deliverytype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_shop_deliveryType" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED, "deliverytype_id" bigint NOT NULL REFERENCES "products_deliverytype" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_generalcategoriesofproduct" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_products_generalType" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "products_id" bigint NOT NULL REFERENCES "products_products" ("id") DEFERRABLE INITIALLY DEFERRED, "generalcategoriesofproduct_id" bigint NOT NULL REFERENCES "products_generalcategoriesofproduct" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_additionalattributes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_shop_additionalAttributes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED, "additionalattributes_id" bigint NOT NULL REFERENCES "products_additionalattributes" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_commontypeofcategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "slug" varchar(100) NOT NULL UNIQUE, "title" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_products" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "description" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "photo" varchar(100) NOT NULL, "is_published" bool NOT NULL, "category_id" bigint NOT NULL REFERENCES "products_category" ("id") DEFERRABLE INITIALLY DEFERRED, "carbs" real NULL, "fat" real NULL, "protein" real NULL, "show_calories" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "products_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "lft" integer unsigned NOT NULL CHECK ("lft" >= 0), "rght" integer unsigned NOT NULL CHECK ("rght" >= 0), "tree_id" integer unsigned NOT NULL CHECK ("tree_id" >= 0), "level" integer unsigned NOT NULL CHECK ("level" >= 0), "photo" varchar(100) NOT NULL, "common_type_category_id" bigint NULL REFERENCES "products_commontypeofcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "parent_id" bigint NULL REFERENCES "products_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "faq_faq" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "question" varchar(99) NOT NULL, "answer" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_published" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "faq_faqcontactform" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "email" varchar(300) NOT NULL, "fio" varchar(300) NOT NULL, "question" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "subscription_subscriptionemail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "email" varchar(99) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "pages_page" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "slug" varchar(99) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "photo" varchar(100) NOT NULL, "is_published" bool NOT NULL, "content" text NOT NULL);
CREATE TABLE IF NOT EXISTS "configs_mainpageinfo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "label_info_desc" varchar(200) NOT NULL, "photo_info" varchar(100) NOT NULL, "label_info_1" varchar(200) NOT NULL, "label_info_1_desc" varchar(200) NOT NULL, "photo_info_1" varchar(100) NOT NULL, "label_info_2" varchar(200) NOT NULL, "label_info_2_desc" varchar(200) NOT NULL, "photo_info_2" varchar(100) NOT NULL, "label_info_3" varchar(200) NOT NULL, "label_info_3_desc" varchar(200) NOT NULL, "photo_info_3" varchar(100) NOT NULL, "label_author" varchar(200) NOT NULL, "label_author_desc" varchar(200) NOT NULL, "photo_author" varchar(100) NOT NULL, "updated_at" datetime NOT NULL, "label_info_title" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "reviews_reviews" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user" varchar(99) NOT NULL, "description" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "grade" integer NOT NULL, "photo" varchar(100) NOT NULL, "is_published" bool NOT NULL, "label" varchar(99) NOT NULL);
CREATE TABLE IF NOT EXISTS "configs_mainpagesale" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subtitle" varchar(200) NOT NULL, "title" varchar(200) NOT NULL, "button_label" varchar(20) NOT NULL, "link" varchar(500) NOT NULL, "photo" varchar(100) NOT NULL, "description" varchar(500) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_city" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "coordinate_w" real NOT NULL, "coordinate_h" real NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "country_id" bigint NOT NULL REFERENCES "products_country" ("id") DEFERRABLE INITIALLY DEFERRED, "zoom" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "banners_banners" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(99) NOT NULL, "link" varchar(300) NOT NULL, "photo" varchar(100) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "description" varchar(1000) NOT NULL, "shop_id" bigint NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED, "city_id" bigint NULL REFERENCES "products_city" ("id") DEFERRABLE INITIALLY DEFERRED, "deadline_date" date NULL);
CREATE TABLE IF NOT EXISTS "products_shopimage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "image" varchar(100) NOT NULL, "description" varchar(255) NOT NULL, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "statistics_gau_shopviewstatistics" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "client_ip" varchar(100) NOT NULL, "created_at" datetime NOT NULL, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "statistics_gau_productviewstatistics" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "client_ip" varchar(100) NOT NULL, "created_at" datetime NOT NULL, "product_id" bigint NOT NULL REFERENCES "products_products" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "reviews_shop_reviewsshop" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user" varchar(99) NULL, "description" text NOT NULL, "created_at" datetime NOT NULL, "grade" integer NOT NULL, "shop_id" bigint NOT NULL REFERENCES "products_shop" ("id") DEFERRABLE INITIALLY DEFERRED);
